import React from "react";
// import "./style.css";

function SearchResults(props) {
  return (
    <ul className="list-group search-results">


        <li  key={props.first} className="list-group-item">
           <td>{props.first}</td>
           <td>{props.last}</td>
           <td>{props.email}</td>


        </li>

    </ul>
  );
}

export default SearchResults;
